import React, { useState } from "react";

const generateMarketData = () => {
  const data = [];

  for (let i = 0; i < 50; i++) {
    data.push({
      id: "ord-" + i,
      sym: "STK-" + (100 + i),
      price: (Math.random() * 400 - 100).toFixed(2),
      qty: Math.floor(Math.random() * 500),
    });
  }

  return data;
}

const result = generateMarketData();
console.log(result);
